// src/pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import backgroundImage from 'frontend\background.png'; // Import the background image

function Home() {
  return (
    <div style={{ backgroundImage: `url(${backgroundImage})`, backgroundSize: 'cover', backgroundPosition: 'center', height: '100vh' }}>
      <div>
        <h1>Welcome to Car Pooling Ride Sharing</h1>
        <ul>
          <li><Link to="/signup">Sign Up</Link></li>
          <li><Link to="/login">Log In</Link></li>
          <li><Link to="/rides">Find Rides</Link></li>
          <li><Link to="/dashboard">Dashboard</Link></li>
          {/* Add more links for other pages as needed */}
        </ul>
      </div>
    </div>
  );
}

export default Home;
